// LoginPage.js
import React from 'react';
import { useAuth } from './AuthContext';

const LoginPage = () => {
    const { login } = useAuth();

    const handleLogin = () => {
        login();
    };

    return (
        <div className="container">
            <h2>Login Page</h2>
            <h1>Find the most
                <br />Exciting Jobs
            </h1>



            <button onClick={handleLogin}>Login</button>
        </div>
    );
};

export default LoginPage;
